DROP TABLE IF EXISTS magasin CASCADE;
DROP TABLE IF EXISTS client CASCADE;
DROP TABLE IF EXISTS produit CASCADE;
DROP TABLE IF EXISTS stocke CASCADE;
DROP TABLE IF EXISTS contient CASCADE;
DROP TABLE IF EXISTS facture CASCADE;

CREATE TABLE magasin(
	idmag int primary key,
	nom varchar(25),
	ville varchar(25),
	tel varchar(10)
);

CREATE TABLE client(
	numcli int primary key,
	nom varchar(25),
	prenom varchar(25),
	ville varchar(25),
	tel varchar(10)
);

CREATE TABLE produit(
	idpro int primary key,
	libelle varchar(25),
	couleur varchar(25)
);

CREATE TABLE facture(
	idfac int primary key,
	date date,
	numcli int references client(numcli),
	idmag int references magasin(idmag)
);

CREATE TABLE contient(
	idfac int references facture(idfac),
	idpro int references produit(idpro),
	prixUnit numeric(5,2),
	quantite int,
	primary key(idfac,idpro)
);

CREATE TABLE stocke(
	idmag int references magasin(idmag),
	idpro int references produit(idpro),
	prixUnit numeric(5,2),
	quanttie int,
	primary key(idmag,idpro)
);


